import React from 'react'
import { Box } from '@mui/system'
import Card from './components/CardTemplate'
const box = {
  textAlign: 'left'
}

const data = {
  title:'test title',
  description:'test desc'
}


const HistoryOfCS = () => {
  return (
    <>
      <Box sx={box}>

        {data.map((data)=>(
          <h5>{data.title}</h5>
        ))}
        <div>
          <h3>5 main computing disciples and majors:</h3>
          <ul>
            <li>Computer Engineering</li>
            Typically involves software and hardware and the development of systems that involve software, hardware, and communications.
            <li></li>
            <li></li>
          </ul>
        </div>
      </Box>
    </>
  )
}

export default HistoryOfCS
